import { Component, OnInit } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';
import { Router } from '@angular/router';
import { BooksService } from '../books.service';
import { Book } from '../model/book';
import { User } from '../model/user';

@Component({
  selector: 'app-add-book',
  templateUrl: './add-book.component.html',
  styleUrls: ['./add-book.component.css']
})
export class AddBookComponent implements OnInit {

  constructor(private domSanitizer: DomSanitizer, private router: Router, private bookService: BooksService) { }

  ngOnInit(): void {
    this.user = JSON.parse(sessionStorage.getItem('user'))
    this.bookService.getAllBookRequests().subscribe((data: Book[])=>{
      this.bookRequests = data
      this.bookService.getAllBooks().subscribe((data: Book[])=>{
        this.allBooks = data
        this.sortedBooks = this.bookService.sortBooksByID(this.allBooks)
        if(this.sortedBooks.length == 0){
          this.id = 1
        }
        else{
          this.maxID = this.sortedBooks[0].bookID
          this.id = this.maxID + 1;
        }
      })
    })
  }

  bookRequests: Book[] = []
  allBooks: Book[] = []
  sortedBooks: Book[] = []
  maxID: number
  user: User
  id: number
  title: string
  author: string
  genre: string
  publisher: string
  year: string
  language: string
  picture: string
  saved: boolean
  message: string
  genreList: string[] = ['Fikcija', 'Roman', 'Drama', 'Istorijski', 'Epski'];
  genresToAdd: string[] = []

  addPicture(fileInput: any) {
    this.picture = null
    this.saved = false
    if (fileInput.target.files && fileInput.target.files[0]) {

      const reader = new FileReader();
      reader.onload = (e: any) => {
        const image = new Image();
        image.src = e.target.result;
        image.onload = rs => {
          const img_height = rs.currentTarget['height'];
          const img_width = rs.currentTarget['width'];

          console.log(img_height, img_width);

          const imgBase64Path = e.target.result;
          this.picture = imgBase64Path;
          this.saved = true;
          return true
        };
      };

      reader.readAsDataURL(fileInput.target.files[0]);
    }
  }

  picturePath() {
    return this.domSanitizer.bypassSecurityTrustUrl(this.picture)
  }

  add(){
    this.genre = ""
    this.genresToAdd.forEach(element => {
      this.genre += (element + " ")
    });
    if(this.picture == null){
      this.picture = 'data:image/jpeg;base64,'
    }
    this.bookService.add(this.id, this.title, this.author, this.genre, this.publisher, this.year, this.language, this.picture).subscribe(respObj=>{
      if(respObj['message']=='ok'){
        this.message = "Knjiga dodata"
        alert(this.message)
        if(this.user.type == 2){
          this.router.navigate(['admin'])
        } else if(this.user.type == 1){
          this.router.navigate(['mod'])
        }
      }
      else{
        this.message = 'Error'
      }
    })
  }

  front(){
    if(this.user.type == 1){
      this.router.navigate(["mod"])
    }
    else if(this.user.type == 2){
      this.router.navigate(["admin"])
    }
    else this.router.navigate(["front-page"])
  }

}
